// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.7.0 <0.9.0;

import "./Management.sol";
import "./Database.sol";

/**
 * @title FoodChainMonitoring
 * @dev Store & retrieve value in a variable
 */
contract Tracking {
    // debug
    event _exposePackHash(
        bytes32 packHash,
        address owner,
        bytes32[] ingredients
    );

    struct HoldersMapping {
        address holderAddress;
        uint256 timestamp;
    }

    struct FinalProductsMapping {
        // bytes32 _productAddress;
        address _producer;
        bytes32[] _tokens;
        // uint8 _tokensLength;
    }

    struct FCToken {
        uint8 ingridientID;
        uint8 status; // packed?
        uint8 amount;
        address holder;
        uint256 minted_on;
        uint256 transfered_on;
        address pending_holder;
        mapping(uint8 => HoldersMapping) past_holders;
        uint8 past_holders_length;
    }

    mapping(bytes32 => FCToken) _universeTokens;
    mapping(address => bytes32[]) _userTokens;
    mapping(address => bytes32[]) _userPendingTokens;

    // address of the Final Product -> struct of the product
    mapping(bytes32 => FinalProductsMapping) _finalProducts;
    mapping(address => bytes32[]) _userPacks;

    address management_sc;
    address database_sc;
    address admin;

    constructor() {
        admin = msg.sender;
    }

    function set_management_sc(address _msc) public {
        require(msg.sender == admin, "Only admin can set perms");
        management_sc = _msc;
    }

    function get_management_sc() public view returns (address) {
        return management_sc;
    }

    function set_database_sc(address _msc) public {
        require(msg.sender == admin, "Only admin can set perms");
        database_sc = _msc;
    }

    function get_database_sc() public view returns (address) {
        return database_sc;
    }

    function mint_token(uint8 _ingridientID, uint8 _amount)
        public
        returns (bytes32)
    {
        // create check method to verify the generation is valid
        Management m = Management(management_sc);
        require(
            m.get_perm_mint(msg.sender, _ingridientID) == true,
            "No perm to mint"
        );

        uint256 toHash = block.timestamp + _ingridientID;
        bytes32 tokenHash = keccak256(abi.encode(toHash));
        // FCToken storage theToken = tokens[_ingridientID][tokenHash];
        FCToken storage theToken = _universeTokens[tokenHash];

        theToken.amount = _amount;
        theToken.ingridientID = _ingridientID;
        theToken.holder = msg.sender;
        theToken.status = 1; // 1 = ready, 2 = transfer_pending, 3 = packed
        theToken.minted_on = block.timestamp;
        theToken.past_holders_length = 0;

        _userTokens[msg.sender].push(tokenHash);
        // ingridient_tokens[_ingridientID] = tokenHash;
        // token_hashes[tokenHash] = theToken; while the init is on memory
        return tokenHash; // hash has to be generated by ingridient ID, first holder and timestamp
    }

    function transfer_token(
        uint8 _ingridientID,
        bytes32 _tokenHash,
        address _receiver
    ) public returns (bool) {
        // FCToken storage tkn = tokens[_ingridientID][_tokenHash];
        FCToken storage tkn = _universeTokens[_tokenHash];
        require(tkn.status > 0, "Non existent token");
        require(msg.sender == tkn.holder, "You are not allowed"); // Check that the tx.sender is the owner of the token
        require(msg.sender != _receiver, "You are not allowed"); // Check that the tx.sender is the owner of the token
        require(tkn.status == 1, "Token status not ready"); // check the state of the token (it has to be ready)
        // check that the tx.sender can transfer such ingridient
        // check that the tx.receiver can accept such ingridient

        // set pending_holder to receiver
        tkn.pending_holder = _receiver;
        tkn.transfered_on = block.timestamp;
        // set the status -> transfer_pending
        tkn.status = 2;

        _userPendingTokens[_receiver].push(_tokenHash);

        return true;
    }

    function receive_token(uint8 _ingridientID, bytes32 _tokenHash)
        public
        returns (bool)
    {
        // FCToken storage tkn = tokens[_ingridientID][_tokenHash];
        FCToken storage tkn = _universeTokens[_tokenHash];
        require(
            msg.sender == tkn.pending_holder,
            "You are not allowed, different sender than holder"
        );
        require(tkn.status == 2, "Token already received");

        HoldersMapping storage hmap = tkn.past_holders[
            tkn.past_holders_length++
        ]; // stupid syntax -> https://ethereum.stackexchange.com/questions/87451/solidity-error-struct-containing-a-nested-mapping-cannot-be-constructed
        hmap.holderAddress = tkn.holder;
        hmap.timestamp = block.timestamp;
        tkn.holder = msg.sender;
        tkn.pending_holder = address(0);
        tkn.status = 1;

        for (
            uint256 index = 0;
            index < _userPendingTokens[msg.sender].length;
            index++
        ) {
            if (_userPendingTokens[msg.sender][index] == _tokenHash) {
                delete _userPendingTokens[msg.sender][index];
                break;
            }
        }

        for (
            uint256 index = 0;
            index < _userTokens[hmap.holderAddress].length;
            index++
        ) {
            if (_userTokens[hmap.holderAddress][index] == _tokenHash) {
                delete _userTokens[hmap.holderAddress][index];
                break;
            }
        }
        _userTokens[msg.sender].push(_tokenHash);

        return true;
    }

    function private_receive_token(
        bytes32 _tokenHash,
        address _sender
    ) private {
        // FCToken storage tkn = tokens[_ingridientID][_tokenHash];
        FCToken storage tkn = _universeTokens[_tokenHash];
        require(
            _sender == tkn.pending_holder,
            "You are not allowed, different sender than holder"
        );
        require(tkn.status == 2, "Token already received");

        HoldersMapping storage hmap = tkn.past_holders[
            tkn.past_holders_length++
        ]; // stupid syntax -> https://ethereum.stackexchange.com/questions/87451/solidity-error-struct-containing-a-nested-mapping-cannot-be-constructed

        // address currentHolder = tkn.holder;
        hmap.holderAddress = tkn.holder;
        hmap.timestamp = block.timestamp;
        tkn.holder = msg.sender;
        tkn.pending_holder = address(0);
        tkn.status = 1;
        // _userTokens[currentHolder][_tokenHash] = 0;
        for (
            uint256 index = 0;
            index < _userPendingTokens[msg.sender].length;
            index++
        ) {
            if (_userPendingTokens[msg.sender][index] == _tokenHash) {
                delete _userPendingTokens[msg.sender][index];
                break;
            }
        }

        for (
            uint256 index = 0;
            index < _userTokens[hmap.holderAddress].length;
            index++
        ) {
            if (_userTokens[hmap.holderAddress][index] == _tokenHash) {
                delete _userTokens[hmap.holderAddress][index];
                break;
            }
        }
        _userTokens[msg.sender].push(_tokenHash);
    }

    function receive_tokens(
        bytes32[] memory _tokenHash
    ) public payable {
        for (uint256 i = 0; i < _tokenHash.length; i++) {
            private_receive_token(_tokenHash[i], msg.sender);
        }
    }

    function split_token(
        uint8 _ingridientID,
        bytes32 _tokenHash,
        uint8 _amount
    ) public returns (bytes32) {
        Management m = Management(management_sc);
        require(
            m.get_perm_split(msg.sender, _ingridientID) == true,
            "No perm to split"
        ); // to be implemented
        // FCToken storage tkn = tokens[_ingridientID][_tokenHash];
        FCToken storage tkn = _universeTokens[_tokenHash];
        require(tkn.status > 0, "Non existent token");
        require(msg.sender == tkn.holder, "You are now allowed"); // Check that the tx.sender is the owner of the token
        require(tkn.status == 1, "Token status not ready"); // check the state of the token (it has to be ready)
        require(_amount > 0, "Invalid split amount");
        require(_amount < tkn.amount, "Invalid split amount");
        tkn.amount = tkn.amount - _amount;

        uint256 toHash = block.timestamp + _ingridientID + 1; //block.timestamp + _ingridientID is the same in the same block
        bytes32 tokenHash = keccak256(abi.encode(toHash));
        // FCToken storage ntkn = tokens[_ingridientID][tokenHash];
        FCToken storage ntkn = _universeTokens[tokenHash];

        ntkn.amount = _amount;
        ntkn.ingridientID = _ingridientID;
        ntkn.holder = msg.sender;
        ntkn.status = 1; // 1 = ready, 2 = transfer_pending, 3 = packed
        ntkn.minted_on = block.timestamp;
        ntkn.past_holders_length = tkn.past_holders_length;
        //ntkn.past_holders = tkn.past_holders;
        _userTokens[msg.sender].push(tokenHash);

        return tokenHash;
    }

    function getTokenData(bytes32 _tokenHash)
        public
        view
        returns (
            uint8,
            uint8,
            uint8,
            address,
            address,
            uint8,
            uint256
        )
    {
        // FCToken storage tkn = tokens[_ingridientID][_tokenHash];
        FCToken storage tkn = _universeTokens[_tokenHash];
        require(tkn.status > 0, "Non existent token");

        return (
            tkn.ingridientID,
            tkn.status,
            tkn.amount,
            tkn.holder,
            tkn.pending_holder,
            tkn.past_holders_length,
            tkn.minted_on
        );
    }

    function pack(bytes32[] memory _tokenHash, address _sender)
        public
        payable
        returns (bytes32)
    {
        // maybe dummy, but 2 loops, one to check permissions the other to alter the tokens
        for (uint256 i = 0; i < _tokenHash.length; i++) {
            // check for permissions and the status of the token
            FCToken storage tkn = _universeTokens[_tokenHash[i]];

            require(
                _sender == tkn.holder,
                "You are not allowed, different holder"
            );
            require(tkn.status == 1, "Token has to be available");
        }

        uint256 toHash = block.timestamp + 1; //block.timestamp + _ingridientID is the same in the same block
        bytes32 packHash = keccak256(abi.encode(toHash));
        FinalProductsMapping storage product = _finalProducts[packHash];

        product._producer = _sender;
        for (uint256 i = 0; i < _tokenHash.length; i++) {
            FCToken storage tkn = _universeTokens[_tokenHash[i]];
            tkn.status = 3;
            product._tokens.push(_tokenHash[i]);
        }
        emit _exposePackHash(packHash, _sender, product._tokens);
        _userPacks[msg.sender].push(packHash);

        return packHash;
    }

    function viewPack(bytes32 _packAddress)
        public
        view
        returns (uint256, bytes32[] memory)
    {
        FinalProductsMapping storage product = _finalProducts[_packAddress];
        require(product._producer != address(0), "Non existent token");

        return (product._tokens.length, product._tokens);
    }

    function getUserPendingTokens(address _owner)
        public
        view
        returns (bytes32[] memory)
    {
        return _userPendingTokens[_owner];
    }

    function getUserTokens(address _owner)
        public
        view
        returns (bytes32[] memory)
    {
        return _userTokens[_owner];
    }
}
